import React from 'react';
import Slider from '@material-ui/core/Slider';
import styles from './TripList.module.css';


export default function SiteSlider ({tripListData}) {

  return (
    <div className={styles.sliderContainer}>
      <div className={styles.slider}>Sport: <Slider  className={styles.sliderBAr}disabled max={5} defaultValue={tripListData.slider.sport} aria-labelledby="continuous-slider" />{tripListData.slider.sport}</div>
      <div className={styles.slider}>Monuments: <Slider  disabled max={5} defaultValue={tripListData.slider.monuments} aria-labelledby="continuous-slider" />{tripListData.slider.monuments}</div>
      <div className={styles.slider}>Party: <Slider disabled max={5} defaultValue={tripListData.slider.party} aria-labelledby="continuous-slider" />{tripListData.slider.party}</div>
      <div className={styles.slider}>Hotels: <Slider disabled max={5} defaultValue={tripListData.slider.hotels} aria-labelledby="continuous-slider" />{tripListData.slider.hotels}</div>
      <div className={styles.slider}>Restaurants: <Slider disabled max={5} defaultValue={tripListData.slider.restaurants} aria-labelledby="continuous-slider" />{tripListData.slider.restaurants}</div>
    </div>
  );
}
